(157, '<div style=\"font-weight:bold;\">\r\n	How many times <i>AptTrainingResources</i> is printed?</div>\r\n<div style=\"font-weight:bold;border:1px solid silver; background-color:white;\">\r\n	<div>\r\n		#include&lt;stdio.h&gt;</div>\r\n	<div>\r\n		int main()</div>\r\n	<div>\r\n		{</div>\r\n	<div>\r\n		&nbsp; &nbsp; int i = -5;</div>\r\n	<div>\r\n		&nbsp; &nbsp; while (i &lt;= 5)</div>\r\n	<div>\r\n		&nbsp; &nbsp; {</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; if (i &gt;= 0)</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; break;</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; else</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; {</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; i++;</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; continue;</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; }</div>\r\n	<div>\r\n		&nbsp; &nbsp; &nbsp; &nbsp; printf(&quot;AptTrainingResources&quot;);</div>\r\n	<div>\r\n		&nbsp; &nbsp; }</div>\r\n	<div>\r\n		&nbsp; &nbsp; return 0;</div>\r\n	<div>\r\n		}</div>\r\n</div>', 1, 17, 4, 1, '2024-01-28 14:09:01', 0, NULL, NULL, '', '', NULL, NULL),
