(181, '<div style=\"font-weight:bold;\">What will be the output of the following program?</div>\n<div style=\"font-weight:bold;\">void f(static int*, extern int);</div>\n<div style=\"font-weight:bold;\">static int b = 12;</div>\n<div style=\"font-weight:bold;\">int main()</div>\n<div style=\"font-weight:bold;\">{</div>\n<div style=\"font-weight:bold;\">static int a[5];</div>\n<div style=\"font-weight:bold;\">register int I;</div>\n<div style=\"font-weight:bold;\">for(I = 0; I < 2; I ++);</div>\n<div style=\"font-weight:bold;\">a[i++] = 2 * i++;</div>\n<div style=\"font-weight:bold;\">f(a, b);</div>\n<div style=\"font-weight:bold;\">for(I = 0; I < 2; I ++)</div>\n<div style=\"font-weight:bold;\">printf(&ldquo;%d&rdquo;, b++);</div>\n<div style=\"font-weight:bold;\">}</div>\n<div style=\"font-weight:bold;\">void f (static int *x, extern int y)</div>\n<div style=\"font-weight:bold;\">{</div>\n<div style=\"font-weight:bold;\">register int I;</div>\n<div style=\"font-weight:bold;\">for(I = 0; I < 2; I ++)</div>\n<div style=\"font-weight:bold;\">*(++x +1) + = 2;</div>\n<div style=\"font-weight:bold;\">y + = 2;</div>\n<div style=\"font-weight:bold;\">}</div>\n', 1, 1, 5, 1, '2024-01-28 14:09:02', 0, NULL, NULL, '', '', NULL, NULL),
