(190, '<div style=\"font-weight:bold;\">\r\n	The following program uses a nested for loop to find the prime numbers from 2 to 100 ?</div>\r\n<div style=\"font-weight:bold;\">\r\n	#include &lt;stdio.h&gt;</div>\r\n<div style=\"font-weight:bold;\">\r\n	int main ()</div>\r\n<div style=\"font-weight:bold;\">\r\n	{</div>\r\n<div style=\"font-weight:bold;\">\r\n	int i, j;</div>\r\n<div style=\"font-weight:bold;\">\r\n	for(i = 2; i&lt;100; i++) {</div>\r\n<div style=\"font-weight:bold;\">\r\n	for(j = 2; j &lt;= (i/j); j++)</div>\r\n<div style=\"font-weight:bold;\">\r\n	if(!(i%j)) break;</div>\r\n<div style=\"font-weight:bold;\">\r\n	if(j &gt; (i/j)) printf(&quot;%d is prime\\n&quot;, i);</div>\r\n<div style=\"font-weight:bold;\">\r\n	}</div>\r\n<div style=\"font-weight:bold;\">\r\n	return 0;</div>\r\n<div style=\"font-weight:bold;\">\r\n	}</div>\r\n<div style=\"font-weight:bold;\">\r\n	a) Syntax error</div>\r\n<div style=\"font-weight:bold;\">\r\n	b) 2 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	4 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	6 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	..........94 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	c) Runtime Error</div>\r\n<div style=\"font-weight:bold;\">\r\n	d)2 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	3 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	5 is prime number..........&nbsp;97 is prime number</div>\r\n<div style=\"font-weight:bold;\">\r\n	e) Compiler error</div>', 1, 10, 5, 1, '2024-01-28 14:09:03', 0, NULL, NULL, '', '', NULL, NULL),
