(260, '<div style=\"font-weight:bold;\">\r\n	What will be the output of the C program?</div>\r\n<div style=\"font-weight:bold;\">\r\n	#include &lt;stdio.h&gt;</div>\r\n<div style=\"font-weight:bold;\">\r\n	int main()</div>\r\n<div style=\"font-weight:bold;\">\r\n	{</div>\r\n<div style=\"font-weight:bold;\">\r\n	int i = 1, j = 1;</div>\r\n<div style=\"font-weight:bold;\">\r\n	for(;j;printf(&quot;%d %d &quot;,i, j))</div>\r\n<div style=\"font-weight:bold;\">\r\n	j = i++ &lt;= 1;</div>\r\n<div style=\"font-weight:bold;\">\r\n	return 0;</div>\r\n<div style=\"font-weight:bold;\">\r\n	}</div>', 1, 40, 6, 1, '2024-01-28 14:09:06', 0, NULL, NULL, '', '', NULL, NULL);
